import React from "react";
import AuthStyle from "../../../styles/Auth/Auts.css";
import GlobalStyle from "../../../styles/Global.css";
import Regist from "./TypeAuth/Regist";
import Login from "./TypeAuth/Login";

const {ContainerAuth} = AuthStyle
const {Container,} = GlobalStyle

function Auth() {

    const type = "log"

    return (
        <Container>
            <ContainerAuth>
                {type == "reg" ? <Regist></Regist> : <Login></Login>}
            </ContainerAuth>
        </Container>
    )
}

export default Auth
